import React from 'react'
import { ToastContainer, toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';


const Home = () => {

const Toast = () => {
  alert('hello')
}

  return (
    <div className='home'>
       <h1>
        Home Page 
      </h1>

      <button 
      onClick={Toast}
      className='btn_css'>
        Log In
      </button>
     
    </div>
  )
}

export default Home
